This is the value, as at the relevant date, for the net market value of investments that include (but are not limited to):
- Interest-rate related investments, loans and advances of the entity;
- Placements, loans with, and debt securities issued by Individuals, Unlisted private incorporated entities, and Unlisted private unincorporated entities (including unlisted private trusts);
- Other placements, loans and debt securities;
- Short term debt securities (e.g. bills of exchange, certificates of deposit, commercial paper, promissory notes); and
- Long term debt securities (e.g. Treasury Bonds, securitised instruments).
This should exclude:
- interest-rate related cash; and
- interest rate related derivative contracts.

This is the value, as at the relevant date, for contributions from employers which are receivable in respect of the reporting period (i.e. due but not received) by the superannuation entity. This includes but is not limited to:
- all mandated employer contributions (superannuation guarantee, superannuation guarantee vouchers, award/productivity, and contributions by the employer under enterprise bargaining agreements or under the superannuation entity's governing rules);
- salary sacrifice contributions;
- voluntary employer contributions;
- contributions by an employer sponsor to reduce the deficit in a defined benefit superannuation entity; and
- contributions receivable from the government in respect of a fully funded superannuation entity for public sector employees.
Do not include rollover amounts.
Assets are to be measured at net market value.

This is the value, as at the relevant date, for  contributions from members which are receivable i.e. due but not received. Includes, but is not limited to:
- member post-tax contributions;
- contributions from self-employed members; 
- member contributions required under an industrial agreement or the entity's governing rules; and
- ETP or 'golden handshake' amounts from the employer where they represent pre-tax contributions;
- Capital gains tax (CGT) exempt contributions.
Assets are to be measured at net market value.
